const JosefinSans100 = `@font-face { font-family: 'Josefin Sans'; font-style: normal; font-weight: 100; src: local('Josefin Sans Thin'), local('JosefinSans-Thin'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans300 = `@font-face { font-family: 'Josefin Sans'; font-style: normal; font-weight: 300; src: local('Josefin Sans Light'), local('JosefinSans-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans100italic = `@font-face { font-family: 'Josefin Sans'; font-style: italic; font-weight: 100; src: local('Josefin Sans Thin Italic'), local('JosefinSans-ThinItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans300italic = `@font-face { font-family: 'Josefin Sans'; font-style: italic; font-weight: 300; src: local('Josefin Sans Light Italic'), local('JosefinSans-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSansRegular = `@font-face { font-family: 'Josefin Sans'; font-style: normal; font-weight: 400; src: local('Josefin Sans Regular'), local('JosefinSans-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans600 = `@font-face { font-family: 'Josefin Sans'; font-style: normal; font-weight: 600; src: local('Josefin Sans SemiBold'), local('JosefinSans-SemiBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSansItalic = `@font-face { font-family: 'Josefin Sans'; font-style: italic; font-weight: 400; src: local('Josefin Sans Italic'), local('JosefinSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans600italic = `@font-face { font-family: 'Josefin Sans'; font-style: italic; font-weight: 600; src: local('Josefin Sans SemiBold Italic'), local('JosefinSans-SemiBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans700 = `@font-face { font-family: 'Josefin Sans'; font-style: normal; font-weight: 700; src: local('Josefin Sans Bold'), local('JosefinSans-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const JosefinSans700italic = `@font-face { font-family: 'Josefin Sans'; font-style: italic; font-weight: 700; src: local('Josefin Sans Bold Italic'), local('JosefinSans-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
